INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (100101, 0, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 27, "獣人族", 2, 8, "A", 155, "人助け、応援", "ヒヨリ", 44, "トゥインクルウィッシュ", "東山奈央", 16, "人助けが大好き！　前向き格闘娘");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (100201, 0, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 5, "ヒューマン", 2, 4, "O", 158, "料理、人間観察", "ユイ", 47, "トゥインクルウィッシュ", "種田梨沙", 17, "戦闘のサポートが得意な、心優しい少女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (100301, 0, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 12, "魔族", 2, 1, "B", 163, "読書、乗馬、お茶", "レイ", 46, "トゥインクルウィッシュ", "早見沙織", 18, "クールで何事にも真っ直ぐな剣士");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (100401, 0, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 10, "ヒューマン", 5, 8, "O", 128, "いたずら、探検", "ミソギ", 27, "リトルリリカル", "諸星すみれ", 9, "探検好きのイタズラっ子");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (100501, 0, "？？？", 25, "獣人族", 8, 11, "O", 146, "ヒーローごっこ", "マツリ", 40, "王宮騎士団（NIGHTMARE）", "下田麻美", 12, "ヒーローに憧れる騎士見習いの少女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (100601, 0, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 22, "魔族", 7, 11, "O", 150, "サックス", "アカリ", 42, "悪魔偽王国軍（ディアボロス）", "浅倉杏美", 13, "甘え上手なみんなの人気者");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (100701, 0, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 23, "魔族", 7, 1, "B", 130, "プリンを食べること", "ミヤコ", 32, "悪魔偽王国軍（ディアボロス）", "雨宮天", 14, "プリン大好きゴースト娘");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (100801, 0, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 10, "エルフ", 15, 10, "AB", 150, "鏡で自分を見ること", "ユキ", 40, "ヴァイスフリューゲル　ランドソル支部", "大空直美", 14, "ボクは誰よりも美しい");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (100901, 0, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 5, "魔族", 13, 7, "A", 159, "小説執筆", "アンナ", 45, "トワイライトキャラバン", "髙野麻美", 17, "前世を信じる中二病患者、「疾風の冥姫」");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (101001, 0, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 22, "獣人族", 10, 9, "O", 155, "空想、ぬいぐるみ集め", "マホ", 42, "自警団（カォン）", "内田真礼", 16, "マホマホ王国のプリンセス");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (101101, 0, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 25, "ヒューマン", 3, 8, "A", 156, "お裁縫", "リノ", 44, "ラビリンス", "阿澄佳奈", 15, "人懐っこくてマシンガントークな妹系少女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (101201, 0, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 24, "エルフ", 6, 12, "A", 156, "妹と遊ぶこと、二度寝、昼寝、早寝", "ハツネ", 46, "フォレスティエ", "大橋彩香", 17, "みんなのために超能力を使う眠り姫");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (101301, 0, "", 21, "魔族", 13, 8, "O", 166, "読書、魔法", "ナナカ", 55, "トワイライトキャラバン", "佳村はるか", 18, "オタク全開な魔法少女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (101401, 0, "test", 3, "獣人族", 10, 11, "AB", 152, "読書、推理", "カスミ", 41, "自警団（カォン）", "水瀬いのり", 15, "頭脳明晰な美少女名探偵");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (101501, 0, "test", 5, "エルフ", 6, 9, "O", 165, "絵本作り", "ミサト", 54, "フォレスティエ", "國府田マリ子", 21, "母性溢れる優しいみんなの「ミサト先生」");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (101601, 0, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 10, "魔族", 14, 4, "O", 167, "ファッション", "スズナ", 48, "ルーセント学院", "上坂すみれ", 18, "天真爛漫で人気者のカリスマモデル");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (101701, 0, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 7, "獣人族", 10, 7, "A", 158, "踊り、空手", "カオリ", 53, "自警団（カォン）", "高森奈津美", 19, "いつでも「なんくるないさ～」な天然娘");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (101801, 0, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 14, "魔族", 14, 8, "B", 162, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", "イオ", 52, "ルーセント学院", "伊藤静", 23, "多くの男性を魅了する無垢な女教師");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (102001, 0, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 3, "獣人族", 5, 4, "O", 117, "かわいいもの集め", "ミミ", 21, "リトルリリカル", "日高里菜", 10, "お歌もにんじんも、ウサギさんも大好き♪");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (102101, 0, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 9, "ヒューマン", 9, 6, "B", 150, "観劇、おままごと", "クルミ", 40, "サレンディア救護院", "植田佳奈", 12, "泣き虫で臆病な守ってあげたい女の子");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (102201, 0, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 22, "魔族", 7, 11, "O", 150, "ゲーム全般", "ヨリ", 40, "悪魔偽王国軍（ディアボロス）", "原紗友里", 13, "人見知りであまのじゃくな女の子");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (102301, 0, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 10, "ヒューマン", 9, 5, "B", 148, "屋内でできる遊び", "アヤネ", 38, "サレンディア救護院", "芹澤優", 14, "ぷうきちといつも一緒！");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (102501, 0, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 12, "ヒューマン", 9, 12, "O", 154, "ご奉仕", "スズメ", 43, "サレンディア救護院", "悠木碧", 15, "お嬢さまのためにがんばるドジっ娘メイド");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (102601, 0, "test", 1, "獣人族", 11, 1, "B", 144, "あんパン", "リン", 42, "牧場（エリザベスパーク）", "小岩井ことり", 17, "遊びと睡眠が何より大事なぐうたら娘");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (102701, 0, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 30, "魔族", 13, 7, "B", 154, "実験、裁縫、料理", "エリコ", 43, "トワイライトキャラバン", "橋本ちなみ", 16, "運命の相手に一途すぎる乙女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (102801, 0, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 4, "エルフ", 9, 10, "A", 156, "経営、お茶会", "サレン", 43, "サレンディア救護院", "堀江由衣", 17, "救護院を経営する優しい庶民派お嬢様");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (102901, 0, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", 24, "ヒューマン", 4, 1, "B", 157, "舞台鑑賞、ダンス", "ノゾミ", 40, "カルミナ", "日笠陽子", 17, "歌って踊れる大人気アイドル");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (103001, 0, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 31, "ヒューマン", 15, 8, "O", 163, "忍法開発", "ニノン", 51, "ヴァイスフリューゲル　ランドソル支部", "佐藤聡美", 16, "トーゴクの神秘、オシエテクダサイ！");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (103101, 0, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 22, "魔族", 7, 12, "AB", 157, "占い", "シノブ", 42, "悪魔偽王国軍（ディアボロス）", "大坪由佳", 18, "占いが得意な霊能少女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (103201, 0, "この私とともにいる限り、\nお金に不自由はさせませんわ！", 12, "ヒューマン", 12, 3, "AB", 157, "慈善事業", "アキノ", 45, "メルクリウス財団", "松嵜麗", 18, "一人前の商人を目指すパワフルお嬢様");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (103301, 0, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 3, "ヒューマン", 11, 3, "B", 142, "漫才", "マヒル", 35, "牧場（エリザベスパーク）", "新田恵海", 20, "みんなを笑顔にするお笑い牧場主");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (103401, 0, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 16, "エルフ", 12, 3, "A", 164, "ウインドーショッピング", "ユカリ", 55, "メルクリウス財団", "今井麻美", 22, "純情でほっとけない大人の女性");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (103601, 0, "test", 2, "エルフ", 5, 2, "A", 118, "お勉強", "キョウカ", 21, "リトルリリカル", "小倉唯", 8, "礼儀正しくしっかり者のちびっ子優等生");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (103701, 0, "test", 11, "ヒューマン", 8, 8, "A", 149, "剣術、年長者をからかう", "トモ", 43, "王宮騎士団（NIGHTMARE）", "茅原実里", 13, "義理堅くてからかい好きな剣術少女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (103801, 0, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", 3, "獣人族", 11, 11, "A", 153, "読書、お散歩", "シオリ", 40, "牧場（エリザベスパーク）", "小清水亜美", 14, "読書が趣味の病弱少女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (104001, 0, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", 6, "エルフ", 6, 6, "AB", 158, "友達作りのイメトレ", "アオイ", 44, "フォレスティエ", "花澤香菜", 13, "「友達」に憧れる、エルフの森の女の子");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (104201, 0, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 3, "ヒューマン", 4, 6, "O", 163, "各種楽器", "チカ", 46, "カルミナ", "福原綾香", 17, "人々を守るために歌う、唱喚士の少女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (104301, 0, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 9, "獣人族", 10, 8, "O", 168, "お菓子作り", "マコト", 54, "自警団（カォン）", "小松未可子", 17, "男勝りで情に厚いワイルド娘");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (104401, 0, "test", 5, "魔族", 7, 5, "A", 172, "世界征服", "イリヤ", 50, "悪魔偽王国軍（ディアボロス）", "丹下桜", "??", "かつては夜を支配した最強の吸血鬼");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (104501, 0, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 19, "ヒューマン", 15, 11, "AB", 157, "小説を読むこと", "クウカ", 49, "ヴァイスフリューゲル　ランドソル支部", "長妻樹里", 18, "妄想大好き！　ほんとは照れ屋な女の子");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (104601, 0, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 1, "獣人族", 12, 3, "AB", 158, "猫とたわむれること", "タマキ", 48, "メルクリウス財団", "沼倉愛美", 18, "弱きを助け強きをくじく猫娘");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (104701, 0, "？？？", 25, "ヒューマン", 8, 10, "A", 171, "格闘技、湯浴み", "ジュン", 50, "王宮騎士団（NIGHTMARE）", "川澄綾子", 25, "素顔を見せない冷静沈着な女性騎士");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (104801, 0, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 11, "ヒューマン", 12, 11, "O", 163, "傭兵などのアルバイト", "ミフユ", 49, "メルクリウス財団", "田所あずさ", 20, "仕事も私事も効率優先な傭兵少女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (104901, 0, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 24, "ヒューマン", 3, 10, "O", 168, "家事全般", "シズル", 54, "ラビリンス", "生天目仁美", 18, "お姉ちゃんがお世話してあげるからねっ！");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (105001, 0, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 3, "魔族", 14, 1, "A", 120, "ファッション誌鑑賞、コスメ集め", "ミサキ", 22, "ルーセント学院", "久野美咲", 11, "ちょっとおませな恋に恋する女の子");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (105101, 0, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", 7, "ヒューマン", 13, 3, "A", 166, "研究、実験", "ミツキ", 53, "トワイライトキャラバン", "三石琴乃", 27, "実験が趣味の危険な科学者");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (105201, 0, "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", 14, "獣人族", 11, 3, "A", 150, "毛繕い、お喋り", "リマ", 100, "牧場（エリザベスパーク）", "徳井青空", 18, "乙女チックなもふもふアニマル");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (105301, 0, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", 28, "ヒューマン", 15, 7, "A", 140, "お菓子屋通い", "モニカ", 33, "ヴァイスフリューゲル　ランドソル支部", "辻あゆみ", 18, "見た目も中身もお子ちゃまな異国の軍人");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (105401, 0, "test", 7, "ヒューマン", 4, 9, "AB", 153, "裁縫", "ツムギ", 45, "カルミナ", "木戸衣吹", 14, "ファッション大好きなキュートガール");
