INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (105601, 0, "test", 11, "ヒューマン", 13, 7, "B", 167, "釣り", "ルカ", 54, "トワイライトキャラバン", "佐藤利奈", 25, "人情味溢れる粋でいなせな「姉御」");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (105701, 0, "私ね、一人前の騎空士になりたいんだ\nいつか父さんみたいな騎空士になって、\n空の果てまで旅する。それが私の夢だよ！", 10, "ヒューマン", "", 3, "O", 156, "冒険、おしゃべり", "ジータ", 45, "？？？", "金元寿子", 17, "空への冒険を夢見る騎空士の少女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (105801, 0, "あ、あの…何か食べ物持っていませんか？\nもう、お腹ペコペコで…", 31, "ヒューマン", 1, 3, "O", 156, "食べ歩き、料理", "ペコリーヌ", 46, "美食殿", "M・A・O", 17, "いつも元気な腹ペコ少女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (105901, 0, "主さまのガイド役を仰せつかりました\nわたくし、主さまに満足していただけるよう\n誠心誠意尽くさせていただきます", 11, "エルフ", 1, 5, "B", 140, "瞑想、動植物の飼育", "コッコロ", 35, "美食殿", "伊藤美来", 11, "主を慕う、小さなガイド役");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (106001, 0, "なに、モタモタしてんのよ\n仕方ないから、あたしが手伝ってあげるわ\nいい？　感謝しなさいよね！", 2, "獣人族", 1, 9, "A", 152, "猫と遊ぶ", "キャル", 39, "美食殿", "立花理香", 14, "行き倒れの謎のネコミミ魔法使い");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (106101, 0, "いいんだ、アタシは……独りでも。大丈夫だから、もう慣れたからさぁ", 11, "ヒューマン", "", 8, "O", 148, "冒険、思い出話", "ムイミ", 40, "？？？", "潘めぐみ", 16, "さまよえる謎の少女");
