INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (107001, 0, "", 24, "エルフ", "", 3, "O", 149, "物真似、芸術鑑賞", "ネネカ", "??", "？？？", "井口裕香", 24, "研究所に隠れ住む物静かなお姉さん");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (107101, 0, "", 7, "ヒューマン", 8, 2, "O", 165, "強敵との闘争", "クリスティーナ", "??", "王宮騎士団（NIGHTMARE）", "たかはし智秋", 27, "傍若無人な王宮騎士団副団長");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (107501, 0, "あ、あの…何か食べ物持っていませんか？\nもう、お腹ペコペコで…", 31, "ヒューマン", 1, 3, "O", 156, "食べ歩き、料理", "ペコリーヌ（サマー）", 46, "美食殿", "M・A・O", 17, "いつも元気な腹ペコ少女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (107601, 0, "主さまのガイド役を仰せつかりました\nわたくし、主さまに満足していただけるよう\n誠心誠意尽くさせていただきます", 11, "エルフ", 1, 5, "B", 140, "瞑想、動植物の飼育", "コッコロ（サマー）", 35, "美食殿", "伊藤美来", 11, "主を慕う、小さなガイド役");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (107701, 0, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 12, "ヒューマン", 9, 12, "O", 154, "ご奉仕", "スズメ（サマー）", 43, "サレンディア救護院", "悠木碧", 15, "お嬢さまのためにがんばるドジっ娘メイド");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (107801, 0, "なに、モタモタしてんのよ\n仕方ないから、あたしが手伝ってあげるわ\nいい？　感謝しなさいよね！", 2, "獣人族", 1, 9, "A", 152, "猫と遊ぶ", "キャル（サマー）", 39, "美食殿", "立花理香", 14, "行き倒れの謎のネコミミ魔法使い");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (107901, 0, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 1, "獣人族", 12, 3, "AB", 158, "猫とたわむれること", "タマキ（サマー）", 48, "メルクリウス財団", "沼倉愛美", 18, "弱きを助け強きをくじく猫娘");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (108001, 0, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 11, "ヒューマン", 12, 11, "O", 163, "傭兵などのアルバイト", "ミフユ（サマー）", 49, "メルクリウス財団", "田所あずさ", 20, "仕事も私事も効率優先な傭兵少女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (108101, 0, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 22, "魔族", 7, 12, "AB", 157, "占い", "シノブ（ハロウィン）", 42, "悪魔偽王国軍（ディアボロス）", "大坪由佳", 18, "占いが得意な霊能少女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (108201, 0, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 23, "魔族", 7, 1, "B", 130, "プリンを食べること", "ミヤコ（ハロウィン）", 32, "悪魔偽王国軍（ディアボロス）", "雨宮天", 14, "プリン大好きゴースト娘");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (108301, 0, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 3, "魔族", 14, 1, "A", 120, "ファッション誌鑑賞、コスメ集め", "ミサキ（ハロウィン）", 22, "ルーセント学院", "久野美咲", 11, "ちょっとおませな恋に恋する女の子");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (108401, 0, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 3, "ヒューマン", 4, 6, "O", 163, "各種楽器", "チカ（クリスマス）", 46, "カルミナ", "福原綾香", 17, "人々を守るために歌う、唱喚士の少女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (108501, 0, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 9, "ヒューマン", 9, 6, "B", 150, "観劇、おままごと", "クルミ（クリスマス）", 40, "サレンディア救護院", "植田佳奈", 12, "泣き虫で臆病な守ってあげたい女の子");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (108601, 0, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 10, "ヒューマン", 9, 5, "B", 148, "屋内でできる遊び", "アヤネ（クリスマス）", 38, "サレンディア救護院", "芹澤優", 14, "ぷうきちといつも一緒！");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (108701, 0, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 27, "獣人族", 2, 8, "A", 155, "人助け、応援", "ヒヨリ（ニューイヤー）", 44, "トゥインクルウィッシュ", "東山奈央", 16, "人助けが大好き！　前向き格闘娘");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (108801, 0, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 5, "ヒューマン", 2, 4, "O", 158, "料理、人間観察", "ユイ（ニューイヤー）", 47, "トゥインクルウィッシュ", "種田梨沙", 17, "戦闘のサポートが得意な、心優しい少女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (108901, 0, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 12, "魔族", 2, 1, "B", 163, "読書、乗馬、お茶", "レイ（ニューイヤー）", 46, "トゥインクルウィッシュ", "早見沙織", 18, "クールで何事にも真っ直ぐな剣士");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (109001, 0, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 30, "魔族", 13, 7, "B", 154, "実験、裁縫、料理", "エリコ（バレンタイン）", 43, "トワイライトキャラバン", "橋本ちなみ", 16, "運命の相手に一途すぎる乙女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (109101, 0, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 24, "ヒューマン", 3, 10, "O", 168, "家事全般", "シズル（バレンタイン）", 54, "ラビリンス", "生天目仁美", 18, "お姉ちゃんがお世話してあげるからねっ！");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (109201, 0, "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", 1, "ヒューマン", "", 12, "AB", 156, "読書", "アン", 55, "？？？", "日笠陽子", 17, "英霊と契約を結んだマナリアの天才王女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (109301, 0, "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", 4, "ヒューマン", "", 2, "O", 144, "食べること、眠ること", "ルゥ", 45, "？？？", "こやまきみこ", 15, "マナリア魔法学院の新入生");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (109401, 0, "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", 3, "半人半竜", "", 11, "B", 167, "ピアノ", "グレア", 67, "？？？", "福原綾香", 17, "人を超越した力を有す心優しい竜姫");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (109501, 0, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 19, "ヒューマン", 15, 11, "AB", 157, "小説を読むこと", "クウカ（オーエド）", 49, "ヴァイスフリューゲル　ランドソル支部", "長妻樹里", 18, "妄想大好き！　ほんとは照れ屋な女の子");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (109601, 0, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 31, "ヒューマン", 15, 8, "O", 163, "忍法開発", "ニノン（オーエド）", 51, "ヴァイスフリューゲル　ランドソル支部", "佐藤聡美", 16, "トーゴクの神秘、オシエテクダサイ！");
