INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (110501, 0, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 7, "獣人族", 10, 7, "A", 158, "踊り、空手", "カオリ（サマー）", 53, "自警団（カォン）", "高森奈津美", 19, "いつでも「なんくるないさ～」な天然娘");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (110601, 0, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 22, "獣人族", 10, 9, "O", 155, "空想、ぬいぐるみ集め", "マホ（サマー）", 42, "自警団（カォン）", "内田真礼", 16, "マホマホ王国のプリンセス");
