INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (111801, 0, "あ、あの…何か食べ物持っていませんか？\nもう、お腹ペコペコで…", 31, "ヒューマン", 1, 3, "O", 156, "食べ歩き、料理", "ぺコリーヌ（ニューイヤー）", 46, "美食殿", "M・A・O", 17, "いつも元気な腹ペコ少女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (111901, 0, "主さまのガイド役を仰せつかりました\nわたくし、主さまに満足していただけるよう\n誠心誠意尽くさせていただきます", 11, "エルフ", 1, 5, "B", 140, "瞑想、動植物の飼育", "コッコロ（ニューイヤー）", 35, "美食殿", "伊藤美来", 11, "主を慕う、小さなガイド役");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (112001, 0, "なに、モタモタしてんのよ\n仕方ないから、あたしが手伝ってあげるわ\nいい？　感謝しなさいよね！", 2, "獣人族", 1, 9, "A", 152, "猫と遊ぶ", "キャル（ニューイヤー）", 39, "美食殿", "立花理香", 14, "行き倒れの謎のネコミミ魔法使い");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (112101, 0, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 12, "ヒューマン", 9, 12, "O", 154, "ご奉仕", "スズメ（ニューイヤー）", 43, "サレンディア救護院", "悠木碧", 15, "お嬢さまのためにがんばるドジっ娘メイド");
