INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (113601, 0, "", 25, "ヒューマン", 8, 10, "A", 171, "格闘技、湯浴み", "ジュン（サマー）", 50, "王宮騎士団（NIGHTMARE）", "川澄綾子", 25, "素顔を見せない冷静沈着な女性騎士");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (113701, 0, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 22, "魔族", 7, 11, "O", 150, "サックス", "アカリ（エンジェル）", 42, "悪魔偽王国軍（ディアボロス）", "浅倉杏美", 13, "甘え上手なみんなの人気者");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (113801, 0, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 22, "魔族", 7, 11, "O", 150, "ゲーム全般", "ヨリ（エンジェル）", 40, "悪魔偽王国軍（ディアボロス）", "原紗友里", 13, "人見知りであまのじゃくな女の子");
