INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (114401, 0, "この私とともにいる限り、\nお金に不自由はさせませんわ！", 12, "ヒューマン", 12, 3, "AB", 157, "慈善事業", "アキノ（クリスマス）", 45, "メルクリウス財団", "松嵜麗", 18, "一人前の商人を目指すパワフルお嬢様");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (114501, 0, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 4, "エルフ", 9, 10, "A", 156, "経営、お茶会", "サレン（クリスマス）", 43, "サレンディア救護院", "堀江由衣", 17, "救護院を経営する優しい庶民派お嬢様");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (114601, 0, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 16, "エルフ", 12, 3, "A", 164, "ウインドーショッピング", "ユカリ（クリスマス）", 55, "メルクリウス財団", "今井麻美", 22, "純情でほっとけない大人の女性");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (114701, 0, "いいんだ、アタシは……独りでも。大丈夫だから、もう慣れたからさぁ", 11, "ヒューマン", "", 8, "O", 148, "冒険、思い出話", "ムイミ（ニューイヤー）", 40, "？？？", "潘めぐみ", 16, "さまよえる謎の少女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (115001, 0, "", 24, "エルフ", "", 3, "O", 149, "物真似、芸術鑑賞", "ネネカ（ニューイヤー）", "??", "？？？", "井口裕香", 24, "研究所に隠れ住む物静かなお姉さん");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (115501, 0, "主さまのガイド役を仰せつかりました\nわたくし、主さまに満足していただけるよう\n誠心誠意尽くさせていただきます", 11, "エルフ", 1, 5, "B", 140, "瞑想、動植物の飼育", "コッコロ（儀装束）", 35, "美食殿", "伊藤美来", 11, "主を慕う、小さなガイド役");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (115601, 0, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 5, "ヒューマン", 2, 4, "O", 158, "料理、人間観察", "ユイ（儀装束）", 47, "トゥインクルウィッシュ", "種田梨沙", 17, "戦闘のサポートが得意な、心優しい少女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (115701, 0, "", 3, "獣人族", 10, 11, "AB", 152, "読書、推理", "カスミ（サマー）", 41, "自警団（カォン）", "水瀬いのり", 15, "頭脳明晰な美少女名探偵");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (115801, 0, "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", 14, "獣人族", 11, 3, "A", 150, "毛繕い、お喋り", "リマ（シンデレラ）", 100, "牧場（エリザベスパーク）", "徳井青空", 18, "乙女チックなもふもふアニマル");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (115901, 0, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 9, "獣人族", 10, 8, "O", 168, "お菓子作り", "マコト（シンデレラ）", 54, "自警団（カォン）", "小松未可子", 17, "男勝りで情に厚いワイルド娘");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (116001, 0, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 22, "獣人族", 10, 9, "O", 155, "空想、ぬいぐるみ集め", "マホ（シンデレラ）", 42, "自警団（カォン）", "内田真礼", 16, "マホマホ王国のプリンセス");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (116201, 0, "", 7, "エルフ", 16, 8, "O", 154, "ダーツ", "クロエ（聖学祭）", 42, "聖テレサ女学院（なかよし部）", "種﨑敦美", 17, "ダウンタウン育ちのダウナー系エルフ");
