INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (116701, 0, "", 6, "エルフ", 6, 6, "AB", 158, "友達作りのイメトレ", "アオイ（作業服）", 44, "フォレスティエ", "花澤香菜", 13, "「友達」に憧れる、エルフの森の女の子");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (116801, 0, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 1, "獣人族", 12, 3, "AB", 158, "猫とたわむれること", "タマキ（作業服）", 48, "メルクリウス財団", "沼倉愛美", 18, "弱きを助け強きをくじく猫娘");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (116901, 0, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 11, "ヒューマン", 12, 11, "O", 163, "傭兵などのアルバイト", "ミフユ（作業服）", 49, "メルクリウス財団", "田所あずさ", 20, "仕事も私事も効率優先な傭兵少女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (117001, 0, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 30, "魔族", 13, 7, "B", 154, "実験、裁縫、料理", "エリコ（サマー）", 43, "トワイライトキャラバン", "橋本ちなみ", 16, "運命の相手に一途すぎる乙女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (117101, 0, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 24, "ヒューマン", 3, 10, "O", 168, "家事全般", "シズル（サマー）", 54, "ラビリンス", "生天目仁美", 18, "お姉ちゃんがお世話してあげるからねっ！");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (117201, 0, "", 24, "ヒューマン", 4, 1, "B", 157, "舞台鑑賞、ダンス", "ノゾミ（サマー）", 40, "カルミナ", "日笠陽子", 17, "歌って踊れる大人気アイドル");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (117301, 0, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 3, "ヒューマン", 4, 6, "O", 163, "各種楽器", "チカ（サマー）", 46, "カルミナ", "福原綾香", 17, "人々を守るために歌う、唱喚士の少女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (117401, 0, "", 7, "ヒューマン", 4, 9, "AB", 153, "裁縫", "ツムギ（サマー）", 45, "カルミナ", "木戸衣吹", 14, "ファッション大好きなキュートガール");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (117501, 0, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", 7, "ヒューマン", 13, 3, "A", 166, "研究、実験", "ミツキ（オーエド）", 53, "トワイライトキャラバン", "三石琴乃", 27, "実験が趣味の危険な科学者");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (117601, 0, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 10, "エルフ", 15, 10, "AB", 150, "鏡で自分を見ること", "ユキ（オーエド）", 40, "ヴァイスフリューゲル　ランドソル支部", "大空直美", 14, "ボクは誰よりも美しい");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (117701, 0, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 7, "獣人族", 10, 7, "A", 158, "踊り、空手", "カオリ（ハロウィン）", 53, "自警団（カォン）", "高森奈津美", 19, "いつでも「なんくるないさ～」な天然娘");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (117801, 0, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 31, "ヒューマン", 15, 8, "O", 163, "忍法開発", "ニノン（ハロウィン）", 51, "ヴァイスフリューゲル　ランドソル支部", "佐藤聡美", 16, "トーゴクの神秘、オシエテクダサイ！");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (117901, 0, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 10, "魔族", 14, 4, "O", 167, "ファッション", "スズナ（ハロウィン）", 48, "ルーセント学院", "上坂すみれ", 18, "天真爛漫で人気者のカリスマモデル");
