INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (119001, 0, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 14, "魔族", 14, 8, "B", 162, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", "イオ（ノワール）", 52, "ルーセント学院", "伊藤静", 23, "多くの男性を魅了する無垢な女教師");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (119101, 0, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 19, "ヒューマン", 15, 11, "AB", 157, "小説を読むこと", "クウカ（ノワール）", 49, "ヴァイスフリューゲル　ランドソル支部", "長妻樹里", 18, "妄想大好き！　ほんとは照れ屋な女の子");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (119201, 0, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 3, "ヒューマン", 11, 3, "B", 142, "漫才", "マヒル（クリスマス）", 35, "牧場（エリザベスパーク）", "新田恵海", 20, "みんなを笑顔にするお笑い牧場主");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (119301, 0, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 25, "ヒューマン", 3, 8, "A", 156, "お裁縫", "リノ（クリスマス）", 44, "ラビリンス", "阿澄佳奈", 15, "人懐っこくてマシンガントークな妹系少女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (119901, 0, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 23, "魔族", 7, 1, "B", 130, "プリンを食べること", "ミヤコ（クリスマス）", 32, "悪魔偽王国軍（ディアボロス）", "雨宮天", 14, "プリン大好きゴースト娘");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (120001, 0, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 24, "ヒューマン", 3, 10, "O", 168, "家事全般", "シズル（ノワール）", 54, "ラビリンス", "生天目仁美", 18, "お姉ちゃんがお世話してあげるからねっ！");
