INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (121201, 0, "", 25, "ヒューマン", 3, 7, "AB", 160, "人間観察", "ラビリスタ（オーバーロード）", "??", "ラビリンス", "沢城みゆき", 25, "秘密結社ラビリンスの『迷宮女王』");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (121301, 0, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 9, "ヒューマン", 9, 6, "B", 150, "観劇、おままごと", "クルミ（ステージ）", 40, "サレンディア救護院", "植田佳奈", 12, "泣き虫で臆病な守ってあげたい女の子");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (121401, 0, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 3, "魔族", 14, 1, "A", 120, "ファッション誌鑑賞、コスメ集め", "ミサキ（ステージ）", 22, "ルーセント学院", "久野美咲", 11, "ちょっとおませな恋に恋する女の子");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (121501, 0, "", 7, "エルフ", 15, 4, "O", 155, "観察", "アユミ（怪盗）", 43, "ヴァイスフリューゲル　ランドソル支部", "大関英里", 16, "どこまでも一途に慕う、純情乙女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (121601, 0, "", 29, "ドラゴン族", 17, 9, "AB", 145, "ゲーム", "イノリ（怪盗）", "???", "ドラゴンズネスト", "藤田茜", 13, "口が達者なヘタレドラゴン");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (121901, 0, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 5, "魔族", 13, 7, "A", 159, "小説執筆", "アンナ（パイレーツ）", 45, "トワイライトキャラバン", "髙野麻美", 17, "前世を信じる中二病患者、「疾風の冥姫」");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (122001, 0, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 22, "魔族", 7, 12, "AB", 157, "占い", "シノブ（パイレーツ）", 42, "悪魔偽王国軍（ディアボロス）", "大坪由佳", 18, "占いが得意な霊能少女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (122101, 0, "", 6, "エルフ", 6, 6, "AB", 158, "友達作りのイメトレ", "アオイ（キャンプ）", 44, "フォレスティエ", "花澤香菜", 13, "「友達」に憧れる、エルフの森の女の子");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (122201, 0, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 16, "エルフ", 12, 3, "A", 164, "ウインドーショッピング", "ユカリ（キャンプ）", 55, "メルクリウス財団", "今井麻美", 22, "純情でほっとけない大人の女性");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (122301, 0, "", "?", "魔族", "", "?", "AB", 149, "お散歩、お料理", "ヴァンピィ", 41, "？？？", "釘宮理恵", "??", "けんぞくのご主人様");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (122401, 0, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 27, "獣人族", 2, 8, "A", 155, "人助け、応援", "ヒヨリ（サマー）", 44, "トゥインクルウィッシュ", "東山奈央", 16, "人助けが大好き！　前向き格闘娘");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (122501, 0, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 12, "魔族", 2, 1, "B", 163, "読書、乗馬、お茶", "レイ（サマー）", 46, "トゥインクルウィッシュ", "早見沙織", 18, "クールで何事にも真っ直ぐな剣士");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (122601, 0, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 5, "ヒューマン", 2, 4, "O", 158, "料理、人間観察", "ユイ（サマー）", 47, "トゥインクルウィッシュ", "種田梨沙", 17, "戦闘のサポートが得意な、心優しい少女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (122701, 0, "", 2, "エルフ", 5, 2, "A", 118, "お勉強", "キョウカ（サマー）", 21, "リトルリリカル", "小倉唯", 8, "礼儀正しくしっかり者のちびっ子優等生");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (122801, 0, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 10, "ヒューマン", 5, 8, "O", 128, "いたずら、探検", "ミソギ（サマー）", 27, "リトルリリカル", "諸星すみれ", 9, "探検好きのイタズラっ子");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (122901, 0, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 3, "獣人族", 5, 4, "O", 117, "かわいいもの集め", "ミミ（サマー）", 21, "リトルリリカル", "日高里菜", 10, "お歌もにんじんも、ウサギさんも大好き♪");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (123001, 0, "", "?", "？？？", "", "?", "?", 150, "？？？", "アメス", "???", "？？？", "相坂優歌", "??", "新たな姿で騎士の冒険を支え続ける妖精");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (123101, 0, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 22, "獣人族", 10, 9, "O", 155, "空想、ぬいぐるみ集め", "マホ（エクスプローラー）", 42, "自警団（カォン）", "内田真礼", 16, "マホマホ王国のプリンセス");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (123201, 0, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 10, "ヒューマン", 9, 5, "B", 148, "屋内でできる遊び", "アヤネ（エクスプローラー）", 38, "サレンディア救護院", "芹澤優", 14, "ぷうきちといつも一緒！");
