INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (124701, 0, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", 7, "ヒューマン", 13, 3, "A", 166, "研究、実験", "ミツキ（ニューイヤー）", 53, "トワイライトキャラバン", "三石琴乃", 27, "実験が趣味の危険な科学者");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (124801, 0, "", 24, "ヒューマン", 4, 1, "B", 157, "舞台鑑賞、ダンス", "ノゾミ（リベレイター）", 40, "カルミナ", "日笠陽子", 17, "歌って踊れる大人気アイドル");
