INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (125001, 0, "いいんだ、アタシは……独りでも。大丈夫だから、もう慣れたからさぁ", 11, "ヒューマン", "", 8, "O", 148, "冒険、思い出話", "ムイミ（リベレイター）", 40, "？？？", "潘めぐみ", 16, "さまよえる謎の少女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (125101, 0, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 1, "獣人族", 12, 3, "AB", 158, "猫とたわむれること", "タマキ（カフェ）", 48, "メルクリウス財団", "沼倉愛美", 18, "弱きを助け強きをくじく猫娘");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (125201, 0, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", 28, "ヒューマン", 15, 7, "A", 140, "お菓子屋通い", "モニカ（カフェ）", 33, "ヴァイスフリューゲル　ランドソル支部", "辻あゆみ", 18, "見た目も中身もお子ちゃまな異国の軍人");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (125301, 0, "主さまのガイド役を仰せつかりました\nわたくし、主さまに満足していただけるよう\n誠心誠意尽くさせていただきます", 11, "エルフ", 1, 5, "B", 140, "瞑想、動植物の飼育", "コッコロ（レンジャー）", 35, "美食殿", "伊藤美来", 11, "主を慕う、小さなガイド役");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (125401, 0, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", 3, "獣人族", 11, 11, "A", 153, "読書、お散歩", "シオリ（レンジャー）", 40, "牧場（エリザベスパーク）", "小清水亜美", 14, "読書が趣味の病弱少女");
