INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (126701, 0, "この私とともにいる限り、\nお金に不自由はさせませんわ！", 12, "ヒューマン", 12, 3, "AB", 157, "慈善事業", "アキノ（サマー）", 45, "メルクリウス財団", "松嵜麗", 18, "一人前の商人を目指すパワフルお嬢様");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (126801, 0, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 16, "エルフ", 12, 3, "A", 164, "ウインドーショッピング", "ユカリ（サマー）", 55, "メルクリウス財団", "今井麻美", 22, "純情でほっとけない大人の女性");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (126901, 0, "", 28, "魔族", 19, 12, "O", 165, "歌、読書、詩を書くこと", "ランファ（サマー）", 53, "レイジ・レギオン", "原田彩楓", 20, "静寂を求め歌う陰気少女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (127001, 0, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 19, "ヒューマン", 15, 11, "AB", 157, "小説を読むこと", "クウカ（サマー）", 49, "ヴァイスフリューゲル　ランドソル支部", "長妻樹里", 18, "妄想大好き！　ほんとは照れ屋な女の子");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (127101, 0, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 22, "魔族", 7, 12, "AB", 157, "占い", "シノブ（サマー）", 42, "悪魔偽王国軍（ディアボロス）", "大坪由佳", 18, "占いが得意な霊能少女");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (127201, 0, "なに、モタモタしてんのよ\n仕方ないから、あたしが手伝ってあげるわ\nいい？　感謝しなさいよね！", 2, "獣人族", 1, 9, "A", 152, "猫と遊ぶ", "キャル（編入生）", 39, "美食殿", "立花理香", 14, "行き倒れの謎のネコミミ魔法使い");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (127301, 0, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 10, "魔族", 14, 4, "O", 167, "ファッション", "スズナ（編入生）", 48, "ルーセント学院", "上坂すみれ", 18, "天真爛漫で人気者のカリスマモデル");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (127501, 0, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 4, "エルフ", 9, 10, "A", 156, "経営、お茶会", "サレン（サラサリア）", 43, "サレンディア救護院", "堀江由衣", 17, "救護院を経営する優しい庶民派お嬢様");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (127601, 0, "", 11, "ヒューマン", 13, 7, "B", 167, "釣り", "ルカ（サラサリア）", 54, "トワイライトキャラバン", "佐藤利奈", 25, "人情味溢れる粋でいなせな「姉御」");
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (127901, 0, "あ、あの…何か食べ物持っていませんか？\nもう、お腹ペコペコで…", 31, "ヒューマン", 1, 3, "O", 156, "食べ歩き、料理", "ペコリーヌ（クリスマス）", 46, "美食殿", "M・A・O", 17, "いつも元気な腹ペコ少女");
