INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (128801, 0, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 12, "魔族", 2, 1, "B", 163, "読書、乗馬、お茶", "レイ（アストラル）", 46, "トゥインクルウィッシュ", "早見沙織", 18, "クールで何事にも真っ直ぐな剣士");
